import React from 'react';
import Button from '../components/Button/Button';

class ButtonLogic extends React.Component {

    constructor (props) {
       super(props);
    }

    render(){
        return (
            <div>
               <h1>CONTAINER Button</h1>
                <Button/>

            </div>

        );
    }
}

export default ButtonLogic;
